import React, { useState } from "react";
import axios from "axios";
import "./BookAppointment.css";

function BookAppointment() {
  const [phoneNumber, setPhoneNumber] = useState("");
  const [userData, setUserData] = useState(null);
  const [newUser, setNewUser] = useState(false);
  const [name, setName] = useState("");
  const [location, setLocation] = useState("");
  const [appointmentType, setAppointmentType] = useState("");
  const [departmentId, setDepartmentId] = useState("");
  const [pocId, setPocId] = useState("");
  const [appointmentDate, setAppointmentDate] = useState("");
  const [appointmentTime, setAppointmentTime] = useState("");
  const [departments, setDepartments] = useState([]);
  const [pocs, setPocs] = useState([]);
  const [dates, setDates] = useState([]);
  const [times, setTimes] = useState([]);

  const fetchUserData = async () => {  
    try {  
     const response = await axios.post("/api/getUserData", { phoneNumber });  
     if (response.data) {  
      setUserData(response.data);  
     } else {  
      setNewUser(true);  
     }  
    } catch (error) {  
     if (error.response) {  
      console.log(error.response.data);  
      console.log(error.response.status);  
      console.log(error.response.headers);  
     } else if (error.request) {  
      console.log(error.request);  
     } else {  
      console.log('Error', error.message);  
     }  
     console.log(error.config);  
    }  
  };
  

  const saveNewUser = async () => {
    try {
      const response = await axios.post("/api/insertUser", { phoneNumber, name, location });
      setUserData(response.data);
      setNewUser(false);
    } catch (error) {
      console.error("Error saving new user:", error);
    }
  };

  const fetchDepartments = async () => {
    try {
      const response = await axios.get("/api/getDepartments");
      setDepartments(response.data);
    } catch (error) {
      console.error("Error fetching departments:", error);
    }
  };

  const fetchPOCs = async (departmentId) => {
    try {
      const response = await axios.get(`/api/getPOCs/${departmentId}`);
      setPocs(response.data);
    } catch (error) {
      console.error("Error fetching POCs:", error);
    }
  };

  const fetchAvailableDates = async (pocId) => {
    try {
      const response = await axios.get(`/api/getAvailableDates/${pocId}`);
      setDates(response.data);
    } catch (error) {
      console.error("Error fetching available dates:", error);
    }
  };

  const fetchAvailableTimes = async (pocId, date) => {
    try {
      const response = await axios.get(`/api/getAvailableTimes/${pocId}/${date}`);
      setTimes(response.data);
    } catch (error) {
      console.error("Error fetching available times:", error);
    }
  };

  const handleConfirm = async () => {
    try {
      const appointmentData = {
        userId: userData.User_ID,
        appointmentType,
        pocId,
        appointmentDate,
        appointmentTime,
      };
      await axios.post("/api/bookAppointment", appointmentData);
      alert("Appointment booked successfully!");
    } catch (error) {
      console.error("Error booking appointment:", error);
    }
  };

  return (
    <div className="book-appointment">
      <h2>Book Appointment</h2>

      {!userData && (
        <div>
          <input
            type="text"
            placeholder="Enter Phone Number"
            value={phoneNumber}
            onChange={(e) => setPhoneNumber(e.target.value)}
          />
          <button onClick={fetchUserData}>Fetch User</button>
        </div>
      )}

      {newUser && (
        <div>
          <input
            type="text"
            placeholder="Enter Name"
            value={name}
            onChange={(e) => setName(e.target.value)}
          />
          <input
            type="text"
            placeholder="Enter Location"
            value={location}
            onChange={(e) => setLocation(e.target.value)}
          />
          <button onClick={saveNewUser}>Save User</button>
        </div>
      )}

      {userData && (
        <>
          <div>
            <label>Appointment Type</label>
            <select onChange={(e) => setAppointmentType(e.target.value)}>
              <option value="">Select</option>
              <option value="Tele Consultation">Tele Consultation</option>
              <option value="Direct Consultation">Direct Consultation</option>
            </select>
          </div>

          <div>
            <label>Department</label>
            <select onChange={(e) => {
              setDepartmentId(e.target.value);
              fetchPOCs(e.target.value);
            }}>
              <option value="">Select</option>
              {departments.map((dept) => (
                <option key={dept.id} value={dept.id}>
                  {dept.name}
                </option>
              ))}
            </select>
          </div>

          <div>
            <label>POC</label>
            <select onChange={(e) => {
              setPocId(e.target.value);
              fetchAvailableDates(e.target.value);
            }}>
              <option value="">Select</option>
              {pocs.map((poc) => (
                <option key={poc.id} value={poc.id}>
                  {poc.name}
                </option>
              ))}
            </select>
          </div>

          <div>
            <label>Date</label>
            <select onChange={(e) => {
              setAppointmentDate(e.target.value);
              fetchAvailableTimes(pocId, e.target.value);
            }}>
              <option value="">Select</option>
              {dates.map((date) => (
                <option key={date} value={date}>
                  {date}
                </option>
              ))}
            </select>
          </div>

          <div>
            <label>Time</label>
            <select onChange={(e) => setAppointmentTime(e.target.value)}>
              <option value="">Select</option>
              {times.map((time) => (
                <option key={time} value={time}>
                  {time}
                </option>
              ))}
            </select>
          </div>

          <button onClick={handleConfirm}>Confirm Appointment</button>
        </>
      )}
    </div>
  );
}

export default BookAppointment;
